-- CREACION DE OBJETOS
CREATE TABLE COMUNA
(
  id_comuna NUMBER(6) NOT NULL,
  nombre_comuna VARCHAR2(30) NOT NULL
);
ALTER TABLE COMUNA ADD CONSTRAINT PK_COMUNA PRIMARY KEY (id_comuna);

CREATE TABLE PERIODO_COBRO
  (
    pco_periodo       NUMBER(6) NOT NULL ,
    id_estado_periodo NUMBER(2) NOT NULL ,
    pco_vigencia      NUMBER(1)
  ) ;
ALTER TABLE PERIODO_COBRO ADD CONSTRAINT PK_PERIODO_COBRO PRIMARY KEY (pco_periodo);

CREATE TABLE ESTADO_PAGO
  ( id_estado_pago  NUMBER(2) NOT NULL ,
    epa_descripcion VARCHAR2 (50) NOT NULL ,
    epa_vigencia    VARCHAR2(1) NOT NULL
  );
ALTER TABLE ESTADO_PAGO ADD CONSTRAINT PK_ESTADO_PAGO PRIMARY KEY (id_estado_pago);

CREATE TABLE ESTADO_PERIODO
  ( id_estado_periodo NUMBER(2) NOT NULL,
    epe_descripcion   VARCHAR2 (50) NOT NULL ,
    epe_vigencia      VARCHAR2(1) NOT NULL
  ) ;
ALTER TABLE ESTADO_PERIODO ADD CONSTRAINT PK_ESTADO_PERIODO PRIMARY KEY ( id_estado_periodo );

CREATE TABLE FORMA_PAGO
  ( id_forma_pago   NUMBER(2) NOT NULL ,
    fpa_descripcion VARCHAR2 (50) NOT NULL ,
    fpa_vigencia    VARCHAR2(1) NOT NULL
  ) ;
ALTER TABLE FORMA_PAGO ADD CONSTRAINT PK_FORMA_PAGO PRIMARY KEY ( id_forma_pago );

CREATE TABLE TIPO_PERSONA
  (
    id_tipo_persona       NUMBER(1) NOT NULL,
    tp_descripcion        VARCHAR2(20),
    tp_vigencia         VARCHAR2(1)
  ) ;
ALTER TABLE TIPO_PERSONA ADD CONSTRAINT PK_TIPO_PERSONA PRIMARY KEY (id_tipo_persona);

CREATE TABLE ADMINISTRADOR 
( adm_numrun NUMBER(10) NOT NULL, 
  adm_dvrun VARCHAR2(1) NOT NULL, 
  adm_pnombre VARCHAR2(50) NOT NULL, 
  adm_snombre VARCHAR2(50), 
  adm_apellido_paterno VARCHAR2(50) NOT NULL, 
  adm_apellido_materno VARCHAR2(50),
  adm_vigencia VARCHAR2(1)
);
ALTER TABLE ADMINISTRADOR ADD CONSTRAINT PK_ADMINISTRADOR PRIMARY KEY (adm_numrun);

CREATE TABLE EDIFICIO
  ( id_edificio NUMBER(5) NOT NULL ,
    edi_nombre_edificio VARCHAR2 (50) NOT NULL ,
    edi_direccion VARCHAR2(60) NOT NULL,
    adm_numrun NUMBER(10) NOT NULL,
    id_comuna NUMBER(6) NOT NULL,
    edi_vigencia VARCHAR2(1)
  ) ;
ALTER TABLE EDIFICIO ADD CONSTRAINT PK_EDIFICIO PRIMARY KEY (id_edificio);

CREATE TABLE DEPARTAMENTO
  ( id_edificio NUMBER(5) NOT NULL ,
    nro_departamento NUMBER(5) NOT NULL,
    total_banos NUMBER(2) NOT NULL,
    total_dormitorios NUMBER(2) NOT NULL,
    total_balcones NUMBER(2),
    total_metros_cuadrados NUMBER(5,2) NOT NULL
  ) ;
ALTER TABLE DEPARTAMENTO ADD CONSTRAINT PK_DEPARTAMENTO PRIMARY KEY (id_edificio, nro_departamento);


CREATE TABLE RESPONSABLE_PAGO_GASTO_COMUN
  (
    rpgc_numrun          NUMBER(10) NOT NULL ,
    rpgc_dvrun           VARCHAR2(1) NOT NULL ,
    rpgc_pnombre         VARCHAR2 (50) NOT NULL ,
    rpgc_snombre         VARCHAR2(50),
    rpgc_apellido_paterno VARCHAR2 (50) NOT NULL,
    rpgc_apellido_materno VARCHAR2 (50),
    id_tipo_persona       NUMBER(1) NOT NULL,
    rpcg_vigencia         VARCHAR2(1)
  ) ;
ALTER TABLE RESPONSABLE_PAGO_GASTO_COMUN ADD CONSTRAINT PK_RESP_PAGO_GASTO_COMUN PRIMARY KEY (rpgc_numrun);

CREATE TABLE GASTO_COMUN
  ( pco_periodo                NUMBER(6) NOT NULL ,
    id_edificio NUMBER(5) NOT NULL,
    nro_departamento NUMBER(5) NOT NULL,
    gas_fecha_desde            DATE NOT NULL ,
    gas_fecha_hasta            DATE NOT NULL ,
    gas_gasto_prorrateado      NUMBER (10,2) NOT NULL ,
    gas_fondo_reserva          NUMBER (10,2) ,
    gas_agua_individual        NUMBER (10,2) NOT NULL ,
    gas_combustible_individual NUMBER (10,2) NOT NULL ,
    gas_lavanderia             NUMBER (10,2) ,
    gas_eventos                NUMBER (10,2) ,
    gas_gastos_atrasados       NUMBER (10,2) ,
    gas_multas                 NUMBER (10,2) ,
    gas_gasto_total            NUMBER (10,2) ,
    gas_fecha_pago             DATE NOT NULL, 
    rpgc_numrun                NUMBER(10) NOT NULL
  ) ;
ALTER TABLE GASTO_COMUN ADD CONSTRAINT PK_GASTO_COMUN PRIMARY KEY (pco_periodo,id_edificio, nro_departamento);

CREATE TABLE PAGO_GASTO_COMUN
   (PCO_PERIODO NUMBER(6,0) NOT NULL, 
    ID_EDIFICIO NUMBER(5,0) NOT NULL, 
    NRO_DEPARTAMENTO NUMBER(5,0) NOT NULL,
    PGC_FECHA_CANCELACION DATE NOT NULL, 
    PGC_MONTO_CANCELADO NUMBER(10) NOT NULL,
    ID_FORMA_PAGO NUMBER(2,0) NOT NULL
);
ALTER TABLE PAGO_GASTO_COMUN ADD CONSTRAINT PK_PAGO_GASTO_COMUN PRIMARY KEY (pco_periodo,id_edificio, nro_departamento);


CREATE TABLE GASTO_COMUN_PRUEBAESTPAGO
  ( pco_periodo                NUMBER(6) NOT NULL ,
    id_edificio NUMBER(5) NOT NULL,
    nro_departamento NUMBER(5) NOT NULL,
    gas_fecha_desde            DATE NOT NULL ,
    gas_fecha_hasta            DATE NOT NULL ,
    gas_gasto_prorrateado      NUMBER (10,2) NOT NULL ,
    gas_fondo_reserva          NUMBER (10,2) ,
    gas_agua_individual        NUMBER (10,2) NOT NULL ,
    gas_combustible_individual NUMBER (10,2) NOT NULL ,
    gas_lavanderia             NUMBER (10,2) ,
    gas_eventos                NUMBER (10,2) ,
    gas_gastos_atrasados       NUMBER (10,2) ,
    gas_multas                 NUMBER (10,2) ,
    gas_gasto_total            NUMBER (10,2) ,
    gas_fecha_pago             DATE NOT NULL, 
    id_estado_pago             NUMBER(2),
    rpgc_numrun                NUMBER(10) NOT NULL
  ) ;
ALTER TABLE GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT PK_GASTO_COMUN_PESTPAGO PRIMARY KEY (pco_periodo,id_edificio, nro_departamento);


CREATE TABLE PAGO_GASTO_COMUN_PRUEBAESTPAGO
   (PCO_PERIODO NUMBER(6,0) NOT NULL, 
    ID_EDIFICIO NUMBER(5,0) NOT NULL, 
    NRO_DEPARTAMENTO NUMBER(5,0) NOT NULL,
    PGC_FECHA_CANCELACION DATE NOT NULL, 
    PGC_MONTO_CANCELADO NUMBER(10) NOT NULL,
    ID_FORMA_PAGO NUMBER(2,0) NOT NULL
);
ALTER TABLE PAGO_GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT PK_PAGO_GASTO_COMUN_PESTPAGO PRIMARY KEY (pco_periodo,id_edificio, nro_departamento);

CREATE TABLE PAGO_GASTO_COMUN_MENSUAL
   (PCO_PERIODO NUMBER(6,0) NOT NULL, 
    ID_EDIFICIO NUMBER(5,0) NOT NULL, 
    NRO_DEPARTAMENTO NUMBER(5,0) NOT NULL,
    PGC_FECHA_CANCELACION DATE NOT NULL, 
    PGC_MONTO_CANCELADO NUMBER(10) NOT NULL,
    ID_FORMA_PAGO NUMBER(2,0) NOT NULL
);
ALTER TABLE PAGO_GASTO_COMUN_MENSUAL ADD CONSTRAINT PK_PAGO_GASTO_COMUN_MENSUAL PRIMARY KEY (pco_periodo,id_edificio, nro_departamento);



CREATE SEQUENCE seq_com START WITH 10 INCREMENT BY 10;

ALTER TABLE EDIFICIO ADD CONSTRAINT FK_EDIFICIO_ADMINISTRADOR FOREIGN KEY(adm_numrun) REFERENCES ADMINISTRADOR(adm_numrun);
ALTER TABLE EDIFICIO ADD CONSTRAINT FK_EDIFICIO_COMUNA FOREIGN KEY(id_comuna) REFERENCES COMUNA(id_comuna);
ALTER TABLE DEPARTAMENTO ADD CONSTRAINT FK_DEPARTAMENTO_EDIFICIO FOREIGN KEY(id_edificio) REFERENCES EDIFICIO(id_edificio);
ALTER TABLE RESPONSABLE_PAGO_GASTO_COMUN ADD CONSTRAINT FK_RESP_PAGO_GC_TP_PERSONA FOREIGN KEY(id_tipo_persona) REFERENCES TIPO_PERSONA(id_tipo_persona);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_PERIODO_COBRO FOREIGN KEY(pco_periodo) REFERENCES PERIODO_COBRO (pco_periodo);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_DEPARTAMENTO FOREIGN KEY(id_edificio, nro_departamento) REFERENCES DEPARTAMENTO (id_edificio, nro_departamento);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_RESP_PAGO_GC FOREIGN KEY(rpgc_numrun) REFERENCES RESPONSABLE_PAGO_GASTO_COMUN(rpgc_numrun) ;
ALTER TABLE PERIODO_COBRO ADD CONSTRAINT FK_PER_COBRO_ESTADO_PERIODO FOREIGN KEY (id_estado_periodo) REFERENCES ESTADO_PERIODO (id_estado_periodo) ;
ALTER TABLE PAGO_GASTO_COMUN ADD CONSTRAINT FK_PGCOMUN_GCOMUN FOREIGN KEY(pco_periodo,id_edificio, nro_departamento) REFERENCES GASTO_COMUN (pco_periodo,id_edificio, nro_departamento);
ALTER TABLE PAGO_GASTO_COMUN ADD CONSTRAINT FK_PGCOMUN_FORMA_PAGO FOREIGN KEY(id_forma_pago) REFERENCES FORMA_PAGO(id_forma_pago);
ALTER TABLE GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_GCOMUN_PEPAGO_PERIODO_COBRO FOREIGN KEY(pco_periodo) REFERENCES PERIODO_COBRO (pco_periodo);
ALTER TABLE GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_GCOMUN_PEPAGO_DEPARTAMENTO FOREIGN KEY(id_edificio, nro_departamento) REFERENCES DEPARTAMENTO (id_edificio, nro_departamento);
ALTER TABLE GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_GCOMUNPEPAGO_RESP_PAGO_GC FOREIGN KEY(rpgc_numrun) REFERENCES RESPONSABLE_PAGO_GASTO_COMUN(rpgc_numrun) ;
ALTER TABLE GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_GCOMUN_PESTPAGO_ESTADO_PAGO FOREIGN KEY (id_estado_pago) REFERENCES ESTADO_PAGO(id_estado_pago);
ALTER TABLE PAGO_GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_PGCOMUN_PEPAGO_GCOMUN FOREIGN KEY(pco_periodo,id_edificio, nro_departamento) REFERENCES GASTO_COMUN_PRUEBAESTPAGO (pco_periodo,id_edificio, nro_departamento);
ALTER TABLE PAGO_GASTO_COMUN_PRUEBAESTPAGO ADD CONSTRAINT FK_PGCOMUN_PEPAGO_FORMA_PAGO FOREIGN KEY(id_forma_pago) REFERENCES FORMA_PAGO(id_forma_pago);




